var fs = require('fs');
var config = require('../../config/config');
var date = require('../common/dateFormat');
var test='data:image/png;base64,';
exports.saveimg = function(req, res){
    //var imgData = req.body.imgData;
    var imgData = test;
    //过滤data:URL
    var base64Data = imgData.replace(/^data:image\/\w+;base64,/, "");
    var dataBuffer = new Buffer(base64Data, 'base64');
    var fileName = parseInt((new Date()).getTime() / 1000);
    
    if (!fs.existsSync(config.root + "/img/chart/")){
        fs.mkdirSync(config.root + "/img/chart/");
    }
    fs.writeFile(config.root + "/img/chart/" + fileName +".png", dataBuffer, function(err) {
        if(err){
          res.json({
                code : 100000,
                msg : 'err',
                data: err
            });
        }else{
            res.json({
                code : 100000,
                msg : '成功',
                data: fileName
            });
        }
    });
};